  const {isAuth, setIsAuth} = useContext(AuthContext)
  const login = event => {
    setIsAuth(true)
  }
  return (
      <div>
        <h1>Login Page</h1>
        <form onSubmit={eve}>
          <MyInput type="text" placeholder="Enter the login"/>
          <MyInput type="text" placeholder="Enter the password"/>
          <MyButton onClick={login}>Enter</MyButton>
        </form>
      </div>
    )      
  }
  
  export default Login;
